f the most relatable fitness icons online and beyond. She's also the author of the best-selling book, Hot Body Year Round and is the designer of her own activewear line, POPFLEX.\n\nWith a wide range of free workout videos available, Cassey's channel focuses on ab exercises, butt \u0026 thigh exercises, arm exercises, pilates, cardio routines, fat burning workouts, high intensity interval training workouts (HIIT), stretching and flexibility routines and so much more!\n\n\n***\nDISCLAIMER:\n\nBlogilates and oGorgeous Inc. strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Blogilates and oGorgeous Inc. from any and all claims or causes of action, known or unknown, arising out of Blogilates' and oGorgeous Inc.'s negligence.","commandRuns":[{"startIndex":0,"length":15,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCoQ3NcEGAoiEwiX9tPB1O2HAxVUWbgEHWVKJA4=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/100abchallenge","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUSCg4xMDBhYmNoYWxsZW5nZRgB"}}},"loggingDirectives":{"trackingParams":"CCoQ3NcEGAoiEwiX9tPB1O2HAxVUWbgEHWVKJA4=","enableDisplayloggerExperiment":true}},{"startIndex":27,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB4Q040EGAQiEwiX9tPB1O2HAxVUWbgEHWVKJA5Itq66_Yj97dYd","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbTBJc1BjTmdxdGJzME1qaX
